import React from 'react'
import Webcam from 'react-webcam'

const videoContraints = {
    width: 400,
    height: 400,
    facingMode: "user",
}

function ImageCap() {
  return (
    <div>
        <Webcam
        audio={false}
        videoConstraints={videoContraints}
        screenshotFormat="iamge/jpeg" />
    </div>
  )
}

export default ImageCap
